window.bookSummaryJSON = "<p>An Action-Packed LitRPG Apocalypse!</p> <p>The elves took everything. Following a bloodied slaughter of her whole race, and struggling to stay alive, she had no choice but to survive on her own. That was until the world changed. Her entire planet; a whole cluster was introduced to the vast universe by The System, or perhaps God. A universe filled with endless beings and civilizations that fought for power and dominance.</p> <p>After the integration, Blair finds herself in a forest surrounded by unknown beasts, peril lurking, alone. Alone and with nothing but the mentality to survive, she will have to get stronger in this new unforgiving world of numbers and power.</p> <p>With nothing but the capability to get stronger, her distant dreams of revenge might just become a reality.</p>"; 
